package main

import (
	"fmt"
	"log"
	"net"
	"net/dns"
	"sync"
)

var (
	ips = map[string]string{}
	mu  sync.Mutex
)

func main() {
	// Create a new DNS server
	dns.HandleFunc(".", func(w dns.ResponseWriter, r *dns.Msg) {
		// Forward the request to 8.8.8.8 and 1.1.1.1
		go func() {
			// Create a new DNS client
			client := dns.Client{}
			// Create a new DNS request
			req := r.Copy()
			// Set the server to 8.8.8.8
			req.RecursionAvailable = true
			req.RecursionDesired = true
			req.Server = net.ParseIP("8.8.8.8")
			// Send the request to 8.8.8.8
			resp, _, err := client.Exchange(req, "8.8.8.8:53")
			if err != nil {
				log.Println(err)
				return
			}
			// Set the server to 1.1.1.1
			req.Server = net.ParseIP("1.1.1.1")
			// Send the request to 1.1.1.1
			resp2, _, err := client.Exchange(req, "1.1.1.1:53")
			if err != nil {
				log.Println(err)
				return
			}
			// Store the resolved ips in the map
			mu.Lock()
			defer mu.Unlock()
			for _, answer := range resp.Answer {
				if a, ok := answer.(*dns.A); ok {
					ips[a.Hdr.Name] = a.A
				}
			}
			for _, answer := range resp2.Answer {
				if a, ok := answer.(*dns.A); ok {
					ips[a.Hdr.Name] = a.A
				}
			}
		}()
		// Send the response back to the client
		w.WriteMsg(r)
	})
	// Start the DNS server
	log.Fatal(dns.ListenAndServe("0.0.0.0:53", nil))
}
