function mergeArrays(arr1, arr2) {
  const merged = [...arr1, ...arr2];
  const unique = merged.reduce((acc, current) => {
    const existing = acc.find((item) => item.stepId === current.stepId && item.fieldId === current.fieldId);
    if (existing) {
      existing.message = current.message;
    } else {
      acc.push(current);
    }
    return acc;
  }, []);
  return unique;
}
```

This solution works by first merging the two arrays into one, then using the `reduce` method to iterate over the merged array. For each object, it checks if there is already an object in the accumulator with the same `stepId` and `fieldId`. If there is, it updates the `message` property of the existing object. If not, it adds the current object to the accumulator. The final accumulator is the merged array with unique `stepId`

